    "3226":["从第六位、第七位、第八位各选一个号码组成一注。","从第六位、第七位、第八位各选一个号码组成一注，所选号码与开奖号码全部相同，且顺序一致，即为中奖。","投注方案：02 03 04 开奖号码：只要开奖号码后三位和投注号码相同，且顺序一致，即为中奖。"],
    "3235":["01-20中任意选择3个号码组成一注，所选号码与开奖号码的第一位、第二位、第三位相同，且顺序不限，即为中奖。","从第一位，第二位，第三位各选一个号码组成一注，所选号码与开奖号码全部相同，且顺序不限，即为中奖。","投注方案：02 03 04 开奖号码：只要开奖号码前三位和投注号码相同，且顺序不限，即为中奖。"],
    "3232":["01-20中任意选择3个号码组成一注，所选号码与开奖号码的第六位、第七位、第八位相同，且顺序不限，即为中奖。","从第六位、第七位、第八位各选一个号码组成一注，所选号码与开奖号码全部相同，且顺序不限，即为中奖。","投注方案：02 03 04 开奖号码：只要开奖号码后三位和投注号码相同，且顺序不限，即为中奖。"],
    "3241":["从第一位、第二位各选一个号码组成一注，投注的两个号码与开奖的8个号码中任2个连续号码相同且顺序一致 即为中奖。","从第一位、第二位各选一个号码组成一注，投注的两个号码与开奖的8个号码中任2个连续号码相同且顺序一致 即为中奖。","投注方案：15 09 开奖号码：15 09 * * * * * * ,即为中奖。"],
    "3238":["从1--20中任意选择两个号码组成一注，投注的两个号码与开奖的8个号码中任2个连续号码相同（顺序不限）即为中奖。","从1--20中任意选择两个号码组成一注，投注的两个号码与开奖的8个号码中任2个连续号码相同（顺序不限）即为中奖。","投注方案：15 09 开奖号码：09 15 * * * * * * ,即为中奖。"],
    "3244":["从01-20中任意选择1个以上号码。","从01-20中选择1个号码，每注由1个号码组成，只要开奖号码有包含所选号码，即为中奖。","投注方案：08 开奖号码：只要开奖号码包含08即中任选一中一。"],
