    "3250":["从01-20中任意选择3个以上号码。","从01-20中选择3个号码，每注由3个号码组成，只要开奖号码的任意3位包含所选的3个号码，即为中奖。","投注方案：02 05 08 开奖号码：只要开奖号码包含02，05，08即中任选三中三。"],
