    "3259":["在第一位到第八位任意位置上任意选择1个或1个以上玩法。","从第一位到第八位任意位置上至少选择一个以上玩法，所选玩法与相同位置上的玩法计算结果一致，即为中奖。","投注方案：第一位 “单” 开奖号码：第一位为01、03、05、07、09、11、13、15、17、19，即中第一位“单”玩法 。"],
    "3262":["在第一位到第八位任意位置上任意选择1个或1个以上玩法。","从第一位到第八位任意位置上至少选择一个以上玩法，所选玩法与相同位置上的玩法计算结果一致，即为中奖。 “金”号码：05、10、15、20; “木”号码：01、06、11、16; “水”号码：02、07、12、17; “火”号码：03、08、13、18; “土”号码：04、09、14、19; ","投注方案：第一位 “金” 开奖号码：第一位为05、10、15、20，即中第一位“金”玩法 。"],
