    "3292":["在龙虎选择一种，在玩法PK至少选择一种以上。","从龙虎选择一种，从玩法PK（其上数字为开奖号码具体位置）至少选择一种以上，当投注“龙” ，玩法为“1V2”，开奖号码第1位大于第2位即为中奖；当投注“虎”，玩法为“1V2”，则开奖号码第1位小于第2位即为中奖。","投注方案：龙 1V2  开奖号码：第一位号码大于第二位号码即为中奖 。"],
